import React from 'react';
import styled from 'styled-components';
import './YourPerspective.css';
import TitleBig from './TitleH3.js';

const Container = styled.div`
    width: 1887px;
    height: 1066px;
    margin: 0 0 80px;
    position: relative;
    text-align: center;

`

const Box = styled.div`
    width: 1200px;
    height: 444px;
    text-align: left;
    padding: 50px 10px 35px;
    margin: 50px 344px 0;
    background: #ffc0cb57;;
    position:absolute;
`

class YourPerspective extends React.Component{
    render(){
        return(
            <Container className="Background">
                <Box>
                    <TitleBig text="OUR LEARNERS WORK AT"/>
                </Box>
            </Container>
        );
    }

}

export default YourPerspective;
